  Future<void> fetchDataFromApi() async {
    // Create a map containing the data to be sent in the request body
    final Map<String, dynamic> requestData = {
      'lang': "xhosa"
      // Add other parameters if needed
    };

    // Convert the map to a JSON string
    final String requestBody = jsonEncode(requestData);
    final String apiUrl = 'https://www.site.com/get_informing_section';

    try {
      // Make the POST request
      final http.Response response = await http.post(
        Uri.parse(apiUrl),
        headers: <String, String>{
          'Content-Type': 'application/json; charset=UTF-8',
        },
        body: requestBody,
      );

      if (response.statusCode == 200) {
        final data = json.decode(response.body);

        if (data is Map) {
          if (data.containsKey('categories') && data.containsKey('itemsbycategory')) {
            final Map<String, dynamic> itemsData = data['itemsbycategory'];
            final Map<String, List<Map<String, dynamic>>> typedItems = {};

            itemsData.forEach((key, value) {
              if (value is List && value.isNotEmpty) {
                typedItems[key] = List<Map<String, dynamic>>.from(value);
              }
            });
            print(typedItems["All"]?[0][""]);
            List<Map<String, dynamic>>? categoryRecords = typedItems["All"];
            Map<String, dynamic>? selectedItem = categoryRecords?[0];
            setState(() {

              categories = List<String>.from(data['categories']);
              itemsByCategory = typedItems;
              filterItemsByCategory(selectedCategory);
            });
          }
        }
      }
    } catch (error) {
      print('Error fetching data: $error');
    }
  }

  void filterItemsByCategory(String category) {
    setState(() {
      selectedCategory = category;
      if (category == 'All') {
        filteredItems = itemsByCategory['All']!;
      } else {
        filteredItems = itemsByCategory[category] ?? [];
      }
    });
  }

  void searchItems() {
    final query = searchController.text.toLowerCase();
    setState(() {
      if (query.isEmpty) {
        filterItemsByCategory(selectedCategory);
      } else {
        filteredItems = filteredItems.where((item) {
          final itemName = item["info_item_name"].toLowerCase();
          return itemName.contains(query);
        }).toList();
      }
    });
  }

